const NOT_MOUNTED_YET = {};

class Singleton {
    constructor(closure) {
        this.closure_ = closure;
        this.value_ = NOT_MOUNTED_YET;
    }
    get(...args) {
        if (this.value_ === NOT_MOUNTED_YET) {
            this.value_ = this.closure_(...args);
        }
        return this.value_;
    }
}

